import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import './CustomCarousel.css';

const images = [
    '/images/image1.png', // Relative path to the image in the public directory
    '/images/image2.png',
    '/images/image3.png'
];

const CustomCarousel = () => {
    return (
        <div id="carouselExampleControls" className="carousel slide carousel-container" data-ride="carousel">
            <div className="carousel-inner">
                {images.map((src, index) => (
                    <div className={`carousel-item ${index === 0 ? 'active' : ''}`} key={index}>
                        <img className="d-block w-100 custom-carousel-img" src={src} alt={`Slide ${index + 1}`} />
                    </div>
                ))}
            </div>
            <a className="carousel-control-prev" href="#carouselExampleControls" role="button" data-slide="prev">
                <span className="carousel-control-prev-icon" aria-hidden="true"></span>
                <span className="sr-only">Previous</span>
            </a>
            <a className="carousel-control-next" href="#carouselExampleControls" role="button" data-slide="next">
                <span className="carousel-control-next-icon" aria-hidden="true"></span>
                <span className="sr-only">Next</span>
            </a>
        </div>
    );
};

export default CustomCarousel;
